commit_list.message:
Almost there

- Added the ability to shorten existing URLs;
- Store all shares of the same file in the DB;
- Remove trailing CR character from the clipboard;
- Various optimizations.

Installation improvements

- Don’t allow root;
- Reuse die().

Getting close

- Populated the readme;
- Created an installer;
- Removed the Bash v4 dependency;
- Restricted TTL to 5 minutes and above due to ShoutKey’s limitation.
